import {useSelector, useDispatch} from "react-redux";
import { addPreference,getSavedListings } from "../redux/actions";
import { useState } from "react";

const Saved = () => {
    const savedListings = useSelector(state => state.saved);

    useEffect(() => {
        dispatch(getSavedListings())
    }, [dispatch]);

    console.log("saved listings: ", savedListings)

    return(
        <div>
        {
            savedListings.map((listing,i) => 
                <p>{listing.title}</p>
            )
        }
        </div>
    )

}

export default Saved
